import React from 'react'

export default function ListRender(props) {
  return (
    <div>
        {props.list.map((list)=>{
            return(
                <div className='box' key={list.number}>
                    <div className='task'>
                        {list.title} ({list.date.toLocaleDateString()})
                        <button className="delete">Delete</button>

                    </div>
                </div>
            )
        })}
    </div>
  )
}
